import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Header = () => {
  return (
    <View style={styles.header}>
        <Text style={styles.title}>
          Header
        </Text>
    </View>
  )
}

export default Header;


const styles = StyleSheet.create({
    header: {
        backgroundColor: "coral",
        padding: 20,
        width: '100%',
    },
    title: {
        textAlign: "center"
    }
})
